import React from "react";

const Hero = () => {
  return (
    <div className="hero">
      <h1>
        Level Up Your RPGs experience
        <br />
        <p>with Note Maker's Intuitive Tools!</p>
      </h1>

      <p class="hover-underline-animation">
        <br />
        <br />
        Hover this text to see the effect!
      </p>
    </div>
  );
};

export default Hero;
